import React from "react";
import ReactDOM from "react-dom";

class MyHeader extends React.Component {
  render() {
    return (
      <div>
        <h1>Hello Style!</h1>
        <p>Add a little style!.</p>
      </div>
    );
  }
}
export default MyHeader;
